','Draft',0,0,'2021-06-28 07:04:02.608173','2021-06-28 07:04:02.608206',26,NULL,'document',NULL),(29,'colloboration and partnership policy','xxxxxxxha','[\"\'Policy\'\"]','Internal ','Published',0,0,'2021-06-28 07:05:35.511743','2021-09-10 06:43:26.628839',26,12,'document',NULL),(30,'UNTITLED',NULL,NULL,'Internal','Published',0,0,'2021-06-28 08:01:04.359210','2021-06-28 08:30:02.751394',26,NULL,'document',NULL),(31,'UNTITLED',NULL,NULL,'Internal','Draft',0,0,'2021-06-30 12:42:20.793757','2021-06-30 12:42:20.793813',26,NULL,'document',NULL),(32,'ALCHOHOL AND DRUG ABUSE MANAGEMENT','KoTDA recognizes the use of alcohol and drugs as a serious workplace issue. Not only can the use lead to significant health problems but can be a hazard to other employees.\r\n\r\nThe policy therefore addresses key issues of preventive education, rereferral for treatment and rehabilitation, psychosocial support, acquisition and dissemination of behavior change information, minimization of denial and stigma associated with alcohol and drug dependence, and customization of targets for prevention and control of alcohol and drug abuse to the Authority operations.','[\"\'Drug abuse\'\", \"\'Drug abuse\'\"]','Internal ','Published',0,0,'2021-06-30 12:43:56.738221','2021-09-10 06:42:55.754807',26,12,'document',NULL),(33,'DISABILITY MAINSTREAMING POLICY','The Authority approved the Disability Mainstreaming Policy which aims at providing strategic guidelines in the delivery of services with the aim being to promote inclusion of those abled differently.  \r\n \r\nKOTDA has complied with the implementation of Government policy on affirmative action for people with special needs at the workplace. The Authority has established and operationalized a Disability Mainstreaming Committee, trained staff on disability mainstreaming and related issues, conducted an accessibility and usability audit, and ensured that there is no discrimination in advertising, interviewing, recruitment, industrial attachments, internships, training, and promotions of Persons with Disabilities (PWDs). \r\n\r\nLet\'s all familiarize ourselves with the attached policy and support the Authority initiatives in providing a conducive working environment in which both the employee and stakeholder’s interests are served.','[\'\"\\\'Disability \\\'\"\', \' \"\\\'Disability \\\'\"\', \'\"\\\'Disability \\\'\"\', \' \"\\\'Disability \\\'\"\']','Internal ','Published',0,0,'2021-06-30 12:47:04.892603','2021-09-10 06:43:49.480561',26,12,'document',NULL),(34,'HIV&AIDS  WORKPLACE POLICY','The HIV/AIDS Workplace policy provides a framework for KoTDA to reduce the spread of HIV/AIDS and to manage its impacts.\r\nKoTDA recognizes HIV/AIDS as a workplace issue that affects us as employees and as an organization at large.  The management approved the policy supporting our initiatives in creating an inclusive Nondiscriminatory workplace.\r\n\r\nThe policy covers areas such as Non-discrimination/ stigmatization, HIV Testing or screening, Confidentiality and disclosure, Prevention of new infections, treatment, care & support for employees living with HIV AIDS among others.','[\"\'HIV & AIDS\'\", \"\'HIV & AIDS\'\"]','Internal ','Published',0,0,'2021-06-30 12:54:31.196159','2021-09-10 06:45:08.893343',26,12,'document',NULL),(35,'GENDER MAINSTREAMING POLICY','The HIV/AIDS Workplace policy provides a framework for KoTDA to reduce the spread of HIV/AIDS and to manage its impacts.\r\n\r\nKoTDA recognizes HIV/AIDS as a workplace issue that affects us as employees and as an organization as at large.  The management approved the policy supporting our initiatives in creating an inclusive Nondiscriminatory workplace.\r\n\r\nThe policy covers areas such as Non discrimination/ stigmatization, HIV Testing or screening, Confidentiality and disclosure, Prevention of new infections, Treatment, care & support for employees living with HIV AIDS among others.','[\"\'Gender \'\", \"\'Gender \'\"]','Internal ','Published',0,0,'2021-06-30 13:01:01.551799','2021-09-10 06:44:43.120510',26,12,'document',NULL),(36,'FLEET MANAGEMENT POLICY','The Fleet Management Policy is meant to guide all staff in the Konza Technopolis Development Authority (hereinafter referred to as “KoTDA”) on matters pertaining to transport in the Authority. The Authority considers the Fleet Management Policy as its standard guide for acquiring, replenishment, enhancement, management, use, maintenance, repair and disposal of the authority’s general motor vehicle fleet, in order to provide members of staff with safe, reliable, economical and appropriate modes of transportation.\r\nThis Policy shall cover procedures relating to the management of transport in Konza Technopolis Development Authority. It aims at facilitating understanding of procedures required in running and use of motor vehicles; clarifying eligibility and applicability of transport and traveling in the Authority; increasing efficiency in utilization of transport services by Board and staff; and minimizing complaints/conflicts by all parties involved in the usage of Authority vehicle. \r\nThe Transport Policy is also aimed at aligning the demand and supply of the Authority transport services through effective management, look into the welfare of its staff and Board of Directors, and provide accountability.','[\"\'Fleet management\'\", \"\'Fleet management\'\"]','Internal ','Published',0,0,'2021-07-01 06:42:47.458285','2021-09-10 06:44:16.793168',26,12,'document',NULL),(37,'RECORDS MANAGEMENT POLICY','The Management of the Authority records shall be carried out in compliance with the public archives and documentation service act (Cap 19) and other relevant statutes and regulations','[\"\'Records\'\"]','Internal ','Published',0,0,'2021-07-01 06:52:35.999561','2021-09-10 06:50:30.873747',26,12,'document',NULL),(38,'ICT POLICY','The KoTDA ICT Policy outlines the standards for the Authority’s ICT management. This will ensure that the Authority delivers its services and supports various activities that enhance sustainable development with integrity and without diminishing the Authority’s reputation.\r\nThe Konza Technopolis ICT Policy provides policies and guidelines for compliance, acceptable and secure use of information communication technology within the Authority that must be followed by all staff. It also provides guidelines upon which the policy shall be administered and the correct procedures to be followed.\r\nThe Authority will keep the ICT Policy current and relevant. Therefore, from time to time it will be necessary to modify and amend appropriate sections of this policy or to add new procedures as may arise. Therefore, any suggestions, feedback, or advice on the details of this policy will be highly appreciated and reviewed before being incorporated.','[\'\"\\\'ICT \\\'\"\', \' \"\\\'ICT \\\'\"\', \'\"\\\'ICT \\\'\"\', \' \"\\\'ICT \\\'\"\']','Internal ','Published',0,0,'2021-07-01 07:31:40.590274','2021-09-10 06:46:09.823749',26,12,'document',NULL),(39,'CORPORATE SOCIAL RESPONSIBILITY POLICY','Corporate Social Responsibility (CSR) describes the Authority’s outlook beyond its written mandate to staff, partners, stakeholders and customers. This Policy acknowledges that while the mandated duties of the Authority are critical in national development, a softer touch to the community is also critical and will have a wider societal impact. \r\nUndertaking CSR activities encourages the Authority to operate in more sustainable, ethical and charitable ways. Social responsibility allows the Authority to be reconciled with societal or humane interests of various stakeholders who may be affected in the course of delivery of its mandate. The present Corporate Social Responsibility Policy (hereinafter, “CSR Policy”) establishes a reference framework, from which any Konza Technopolis Development Authority (KoTDA) develops and implements socially responsible behavior.\r\n\r\nThe KoTDA Corporate Social Responsibility Policy outlines the standards for the Authority’s engagement with its stakeholders, partners and communities. This will ensure that the Authority engages with communities in activities that enhance sustainable development with integrity and without diminishing the Authority’s reputation','[\'\"\\\'Corporate Social Responsibility\\\'\"\', \' \"\\\'Corporate Social Responsibility\\\'\"\', \'\"\\\'Corporate Social Responsibility\\\'\"\', \' \"\\\'Corporate Social Responsibility\\\'\"\']','Internal ','Published',0,0,'2021-07-01 07:38:21.120866','2021-09-10 06:50:52.685889',26,12,'document',NULL),(40,'LAND SURVEY POLICY','The KoTDA Land Survey Policy outlines the standards for the Authority’s undertaking of Land Surveys and associated services. This will ensure that the Authority engages with communities in land survey activities that enhance sustainable development with integrity and without diminishing the Authority’s reputation.\r\nThe land survey policy, therefore seeks to codify and domesticate regulations and provisions governing cadastral survey within the Technopolis. Cadastral surveying is the discipline of land surveying that relates to the laws of land ownership and the definition of property boundaries.  \r\nIt involves interpreting and advising on boundary locations, on the status of land ownership and on the rights, restrictions, and interests in property, as well as the recording of such information for use on plans and maps.  It also involves the physical delineation of property boundaries and determination of dimensions, areas and certain rights associated with properties, whether they are on land, water, air, or defined by natural or artificial features.','[\"\'Land survey\'\", \"\'Land survey\'\"]','Internal ','Published',0,0,'2021-07-01 07:43:26.092574','2021-09-10 06:46:37.689483',26,12,'document',NULL),(41,'UNTITLED',NULL,NULL,'Internal','Draft',0,0,'2021-07-01 07:50:00.793707','2021-07-01 07:50:00.793750',26,NULL,'document',NULL),(42,'PHYISCAL PLANNING AND DEVELOPMENT CONTROL','The KoTDA Physical Planning and Development Control Policy outlines the standards for the Authority’s undertaking of Physical Planning and Development Control services. This will ensure that the Authority engages with stakeholders and communities in physical planning activities that enhance sustainable development with integrity and without diminishing the Authority’s reputation\r\nThe Konza Technopolis Physical planning and development control Policy provides policies for undertaking both physical and land use planning as well as development control functions within the Authority that must be followed by all staff and investors. It also provides guidelines upon which the policy shall be administered and the correct procedures to be followed.\r\nThe Authority will keep the Physical planning and development control Policy current and relevant. Therefore, from time to time it will be necessary to modify and amend appropriate sections of this policy or to add new procedures as may arise','[\"\'Physical planning and development Control\'\", \"\'Physical planning and development Control\'\"]','Internal ','Published',0,0,'2021-07-01 08:10:01.287985','2021-09-10 06:47:10.856061',26,12,'document',NULL),(43,'SUPPLY CHAIN MANAGEMENT','',NULL,'Internal ','Draft',0,0,'2021-07-01 08:16:51.033839','2021-09-10 06:49:15.797720',26,22,'document',NULL),(44,'STRATEGICPLANNING MANAGEMENT POLICY','The Konza Technopolis Strategic Plan Policy provides guidelines for undertaking strategic planning functions within the Authority. It also provides a framework upon which the policy shall be administered and the correct procedures to be followed at implementation.\r\nThe Authority shall keep the Strategic Plan current and relevant, with periodic reviews biannually. Therefore, it will be necessary to modify and amend appropriate sections of this policy or to add new procedures as may arise biannually. Any suggestions, feedback or advice on the details of this policy will be highly appreciated and will be reviewed before being incorporated.','[\"\'STRATEGIC PLAN POLICY.\'\", \"\'STRATEGIC PLAN POLICY.\'\"]','Internal ','Published',0,0,'2021-07-01 11:36:19.997809','2021-09-10 06:49:46.416660',26,12,'document',NULL),(45,'UNTITLED',NULL,NULL,'Internal','Draft',0,0,'2021-07-01 11:56:43.220091','2021-07-01 11:56:43.220131',26,NULL,'document',NULL),(46,'Resource center Change request form','Change request for form resource center website','[\'change\', \'request\', \'form\', \'badiliko\']','Internal ','Published',0,0,'2021-07-02 06:01:44.131977','2021-07-02 06:04:38.236457',1,34,'document',NULL),(47,'permitting development control policy','','[\"\'permitting  \'\", \"\'permitting  \'\"]','Internal ','Published',0,0,'2021-07-06 05:48:18.936674','2021-09-10 06:42:21.117440',26,12,'document',NULL),(48,'Konza Word Document Template','Konza Word Document Template','[\'word\', \'.doc\', \'template\', \'document\']','Internal ','Published',0,0,'2021-07-07 12:58:03.205668','2021-07-07 13:00:09.785190',1,37,'document',NULL),(49,'Konza Presentation Template','Konza Presentation Template','[\'konza\', \'presentation\', \'template\', \'slide\', \'slideshow\', \'powerpoint\']','Internal ','Published',0,0,'2021-07-07 13:01:22.909038','2021-07-07 13:03:29.345666',1,37,'document',NULL),(50,'Letterhead template','Letterhead template','[\'letterhead\', \'letter\', \'head\', \'template\', \'document\']','Internal ','Published',0,0,'2021-07-07 13:04:14.916923','2021-07-07 13:06:10.641507',1,37,'document',NULL),(51,'Memo template','Memo Template for KoTDA','[\'memo\', \' kotda\', \'template\', \'konza\']','Internal ','Published',0,0,'2021-07-07 14:13:29.457922','2021-07-07 14:15:42.006702',1,37,'document',NULL),(52,'Advertising brief template','Advertising brief template','[\'advertising\', \'brief\', \'template\']','Internal ','Published',0,0,'2021-07-07 14:16:32.261541','2021-07-07 14:22:49.754588',1,37,'document',1),(53,'Events brief Template','Events brief template'